import React from 'react';

export const About = (props) => {
    return (
        <div id="about">
            <div className="container">
                <div className="row">
                    <div className="col-md-6">
                        <div className="about-text">
                            <h2>{props.data.paragraph}</h2>
                            <div className="row">
                                {props.data
                                    ? props.data.Why.map((d, i) => (
                                          <div
                                              key={`${d.title}-${i}`}
                                              className="col-md-4"
                                          >
                                              {' '}
                                              <div className="service-desc">
                                                  <h3>{d.title}</h3>
                                                  <p>{d.text}</p>
                                              </div>
                                          </div>
                                      ))
                                    : 'loading'}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};
